"codemap.md": [
    {
      "pattern": "^(\\s*)### (.*)",
      "clear": "##",
      "prefix": " -",
      "icon": "level3"
    },
    {
      "pattern": "^(\\s*)## (.*)",
      "clear": "##",
      "prefix": " ",
      "icon": "level2"
    },
    {
      "pattern": "^(\\s*)# (.*)",
      "clear": "#",
      "prefix": "",
      "icon": "level1"
    },
    {
      "pattern": "!\\[image\\]",
      "clear": "![image]",
      "prefix": "<image>",
      "icon": "none"
    }
  ]